INSERT INTO `album` (`albumid`, `albumname`, `albumreleasedate`, `albumdescription`, `albumcoveruri`, `artistid`) VALUES
(1, 'Nevermind', '1991-09-24', 'Nevermind is the second studio album by the American rock band Nirvana, released on September 24, 1991. Produced by Butch Vig, Nevermind was the group''s first release on DGC Records. Frontman Kurt Cobain sought to make music outside the restrictive confines of the Seattle grunge scene, drawing influence from groups such as the Pixies and their use of song volume dynamics.  Despite low commercial expectations by the band and its record label, Nevermind became a surprise success in late 1991, largely due to the popularity of its first single, "Smells Like Teen Spirit". By January 1992, it had replaced Michael Jackson''s album Dangerous at number one on the Billboard charts. The album also produced three other successful singles: "Come as You Are", "Lithium", and "In Bloom". The Recording Industry Association of America has certified the album Diamond (over 10 million copies shipped), and the album has sold over 30 million copies worldwide. Nevermind was responsible for bringing alternative rock to a large mainstream audience, and critics subsequently regarded it as one of the best albums of all time.', './Images/AlbumImages/Nevermind.jpg', 4),
(2, 'In Utero', '1993-09-13', 'In Utero is the third and final studio album by the American grunge band Nirvana, released on September 13, 1993, on DGC Records. Nirvana intended the record to diverge significantly from the polished production of its previous album, Nevermind (1991). To capture a more abrasive and natural sound, the group hired producer Steve Albini to record In Utero during a two-week period in February 1993 at Pachyderm Studio in Cannon Falls, Minnesota. The music was recorded quickly with few studio embellishments, and the song lyrics and album packaging incorporated medical imagery that conveyed frontman Kurt Cobain''s outlook on his publicized personal life and his band''s newfound fame.  Soon after recording was completed, rumors circulated in the press that DGC might not release the album in its original state, as the record label felt that the result was not commercially viable. Although Nirvana publicly denied the statements, the group was not fully satisfied with the sound Albini had captured. Albini declined to alter the album further, and ultimately the band hired Scott Litt to make minor changes to the album''s sound and remix the singles "Heart-Shaped Box" and "All Apologies".  Upon release, In Utero entered the Billboard 200 chart at number one and received critical acclaim as a drastic departure from Nevermind. The record has been certified five times platinum by the Recording Industry Association of America, and has sold 3.58 million copies in the United States alone.', './Images/AlbumImages/Inutero.jpg', 4),
(3, 'Bleach', '1989-06-15', 'Bleach is the debut studio album by the American rock band Nirvana, released in June 1989 through the independent record label Sub Pop. The main recording sessions took place at Reciprocal Recording in Seattle, Washington between December 1988 and January 1989. Nirvana songwriter Kurt Cobain felt pressured to create music for Bleach that conformed to the grunge music style favored by his record label and the contemporary Seattle music scene. The album is regarded as quite negative and bleak; Cobain claimed that most of the lyrics were written the night before recording while he was feeling "pissed off", and that he did not regard them highly. The recording of the album was financed by Jason Everman, who was credited as a guitarist but did not play on any songs.  Bleach was well received by critics, but failed to chart in the U.S. upon its original release. The album was re-released internationally by Geffen Records in 1992 following the success of Nirvana''s second album, Nevermind (1991). The re-release debuted at number 89 on the Billboard 200, and peaked at number 33 on the UK Albums Chart and 34 on the Australian albums chart. In 2009 Sub Pop released a 20th anniversary edition of Bleach featuring a live recording of a Nirvana show in Portland, Oregon from 1990 as extra material. Since its release in 1989, Bleach has sold over 1.7 million units in the United States alone. It is Sub Pop''s best-selling release to date.', './Images/AlbumImages/Bleach.jpg', 4),
(4, 'Boys Don''t Cry', '1980-02-05', 'Boys Don''t Cry is an album by English alternative rock band The Cure. It was released on 5 February 1980 in the UK and in August 1980 in the US. It is a compilation of songs from Three Imaginary Boys, but replacing five of that album''s tracks with different tracks.', './Images/AlbumImages/Boysdontcry.jpg', 2),
(5, 'The Head on the Door', '1985-08-26', 'The Head on the Door is the sixth studio album by British band The Cure, released in 1985. The album is the first to feature drummer Boris Williams, it also features the return of Simon Gallup and is Porl Thompson''s first album as an official member.', './Images/AlbumImages/Theheadonthedoor.jpg', 2),
(6, 'Disintegration', '1989-05-01', 'Disintegration is the eighth studio album by English alternative rock band The Cure, released on 1 May 1989 by Fiction Records. The record marks a return to the introspective and gloomy gothic rock style the band had established in the early 1980s. As he neared the age of thirty, vocalist and guitarist Robert Smith had felt an increased pressure to follow up on the group''s pop successes with a more enduring work. This, coupled with a distaste for the group''s new-found popularity, caused Smith to lapse back into the use of hallucinogenic drugs, the effects of which had a strong influence on the production of the album. The Cure recorded Disintegration at Hookend Recording Studios in Checkendon, Oxfordshire, with co-producer David M. Allen from late 1988 to early 1989. During production, founding member Lol Tolhurst was fired from the band.  In spite of Fiction''s fears that the album would be "commercial suicide", Disintegration became the band''s commercial peak. It charted at number three in the United Kingdom and at number twelve in the United States, and produced several hit singles including "Lovesong", which peaked at number two on the Billboard Hot 100. Disintegration remains The Cure''s highest selling record to date, with more than three million copies sold worldwide. Disintegration was also a critical success, eventually being placed at number 326 on Rolling Stone magazine''s list of the "500 Greatest Albums of All Time". Stephen Thomas Erlewine of AllMusic called it the "culmination of all the musical directions The Cure were pursuing over the course of the ''80s."', './Images/AlbumImages/Disintegration.jpg', 2),
(7, 'Ten', '1991-08-27', 'Ten is the debut studio album by the American alternative rock band Pearl Jam, released on August 27, 1991 through Epic Records. Following the disbanding of bassist Jeff Ament and guitarist Stone Gossard''s previous group Mother Love Bone, the two recruited vocalist Eddie Vedder, guitarist Mike McCready, and drummer Dave Krusen to form Pearl Jam in 1990. Most of the songs began as instrumental jams, to which Vedder added lyrics about topics such as depression, homelessness, and abuse.  Ten was not an immediate success, but by late 1992 it had reached number two on the Billboard 200 chart. The album produced three hit singles: "Alive", "Even Flow", and "Jeremy". While Pearl Jam was accused of jumping on the grunge bandwagon at the time, Ten was instrumental in popularizing alternative rock in the mainstream. The album has been certified diamond by the RIAA in the United States. As of December 2012, it has sold 9,983,000 copies in the U.S., and remains Pearl Jam''s most commercially successful album.', './Images/AlbumImages/Ten.jpg', 3),
(8, 'Vs', '2013-10-19', 'Vs. is the second studio album by the American alternative rock band Pearl Jam, released on October 19, 1993 through Epic Records. After a relentless touring schedule in support of their 1991 debut album Ten, Pearl Jam headed into the studio in early 1993 facing the challenge of following up the commercial success of its debut. The resulting album, Vs., featured a rawer and more aggressive sound compared with the band''s previous release. It was the band''s first collaboration with producer Brendan O''Brien.  Pearl Jam decided to scale back its commercial efforts for Vs., including declining to produce music videos for any of the album’s singles. Upon its release, Vs. set the record for most copies of an album sold in its first week, a record it held for five years. Vs. occupied the number one spot on the Billboard 200 chart for five weeks, the longest duration for a Pearl Jam album. The album has been certified seven times platinum by the RIAA in the United States.', './Images/AlbumImages/Vs.jpg', 3),
(9, 'Hatful of Hollow', '1984-11-12', 'Hatful of Hollow is a compilation album by the English rock band The Smiths, featuring BBC Radio 1 studio recordings and two contemporary singles with their B-sides. It was released on 12 November 1984 by the band''s British record company, Rough Trade, just months after the band''s debut, The Smiths. The album reached No. 7 on the UK Albums Chart and stayed on the chart for 46 weeks. Eventually, on 9 November 1993, it was also released by their American label, Sire Records, which had initially declined to release the album. Sire instead released Louder Than Bombs in the US in 1987, which contains several of the same tracks as on Hatful of Hollow, as well as The World Won''t Listen.  In 2000, Q magazine placed Hatful of Hollow at number 44 in its list of the 100 Greatest British Albums Ever.', './Images/AlbumImages/Hatfulofhollow.jpg', 1),
(10, 'The Smiths', '1984-02-20', 'The Smiths is the debut album by English alternative rock band The Smiths, released on 20 February 1984. The album reached number two on the UK Albums Chart, staying on the chart for 33 weeks. After the original production by Troy Tate was felt to be inadequate, John Porter rerecorded the album in both London and Manchester during breaks in the band''s UK tour during September 1983. The album was well received by the critics as well as the public, and it established The Smiths as a prominent band in the 1980s music scene in the United Kingdom.', './Images/AlbumImages/Thesmiths.jpg', 1),
(11, 'Core', '1992-09-29', 'Core is the debut album by the American rock band Stone Temple Pilots, released on September 29, 1992 through Atlantic Records. The album, which peaked at #1 on the Billboard Heatseekers chart and #3 on the Billboard 200, was certified 8x platinum by the RIAA on December 18, 2001, making it the band''s best-selling album.', './Images/AlbumImages/Core.jpg', 5),
(12, 'Purple', '1994-06-07', 'Purple is the second studio album released by the American rock band Stone Temple Pilots released in June 1994 on Atlantic Records. The album, building off the foundations laid by the band''s debut album Core, was a huge success for the band, debuting at #1 on the Billboard 200 chart and remaining there for three weeks, eventually selling over six million copies. It spawned a number of successful singles — "Vasoline", and "Interstate Love Song" both topped the Mainstream Rock Tracks charts, while "Big Empty" also cracked the top ten. Lesser known album cuts "Pretty Penny" and "Unglued" were also released as promotional radio singles.  The album''s style sees an expansion of the band''s sound. While the band''s debut, Core, had a more grunge-oriented sound with churning guitar riffs and aggressive vocals, Purple saw the band shift to a more alternative rock-style, incorporating a number of influences, including psychedelic and southern rock.  In 2006, the album was ranked number 73 on Guitar World magazine''s list of the 100 greatest guitar albums of all time.', './Images/AlbumImages/Purple.jpg', 5),
(13, 'Badmotorfinger', '1991-09-08', 'Badmotorfinger is the third studio album by the American rock band Soundgarden, released on October 8, 1991 through A&M Records. After touring in support of its previous album, Louder Than Love (1989), Soundgarden began the recording sessions for its next album with new bassist Ben Shepherd. The music on the album maintained the band''s heavy metal sound while featuring an increased focus on songwriting as compared with the band''s previous releases.[1]  The focus on the Seattle grunge scene helped bring attention to Badmotorfinger. The singles "Outshined" and "Rusty Cage" were able to find an audience at rock radio and MTV. Badmotorfinger became the band''s highest charting album at the time on the Billboard 200. The band supported the album with tours of North America and Europe, including opening for Guns N'' Roses on that band''s Use Your Illusion Tour. In 1992, Badmotorfinger was nominated for the Grammy Award for Best Metal Performance. The album has been certified two times platinum by the Recording Industry Association of America (RIAA) in the United States, and had, by October 2010, sold 1,517,000 copies in the United States', './Images/AlbumImages/Badmotorfinger.jpg', 6),
(14, 'Louder Than Love', '1989-09-05', 'Louder Than Love is the second studio album by the American rock band Soundgarden, released on September 5, 1989 through A&M Records. After touring in support of its first full-length studio album, Ultramega OK (1988), Soundgarden signed with A&M and began work on its first album for a major label. The songs on the album featured a metal-leaning grunge sound with some songs featuring unusual or unorthodox time signatures.  Because of some of the song lyrics, a Parental Advisory sticker was placed on the album packaging. Louder Than Love would become the band''s first album to chart on the Billboard 200. The band supported the album with tours of North America and Europe. It was the last Soundgarden album to feature the band''s original bassist, Hiro Yamamoto.', './Images/AlbumImages/Louderthanlove.jpg', 6),
(15, 'Surfer Rosa', '1988-03-21', 'Surfer Rosa is the first full-length album by the American alternative rock band Pixies, released in March 1988 on the British independent record label 4AD. The album''s unusual and offbeat subject matter includes references to mutilation and voyeurism; this is augmented by experimental recording, low-fidelity production and a distinctive drum sound. Surfer Rosa contains many of the elements present in Pixies'' earlier output, including Spanish lyrics and references to Puerto Rico.  Because of 4AD''s independent status, distribution in the United States was handled by British label Rough Trade Records; however, it failed to chart in either the UK or the U.S. "Gigantic" was the only single taken from the release (in a re-recorded version), and only reached number 93 on the UK Singles Chart. Despite this, Surfer Rosa was re-released in the U.S. by Elektra Records in 1992, and in 2005 was certified gold by the Recording Industry Association of America.  Surfer Rosa is often cited as a favorite of music critics, and is frequently included on professional lists of the all-time best rock albums. Many alternative rock artists, including Billy Corgan and PJ Harvey, have cited the album as inspirational; Nirvana''s Kurt Cobain frequently acknowledged that Surfer Rosa was a strong influence on Nevermind, and in 1993 hired the album''s producer Steve Albini to produce his band''s album In Utero.', './Images/AlbumImages/Surferrosa.jpg', 7),
(16, 'Mellon Collie and the Infinite Sadness ', '1995-10-24', 'Mellon Collie and the Infinite Sadness is the third album by American alternative rock band The Smashing Pumpkins, released October 24, 1995 on Virgin Records. Produced by frontman Billy Corgan with Flood and Alan Moulder, the 28-track album was released as a two-disc CD and triple LP. The album features a wide array of styles, as well as greater musical input from bassist D''arcy Wretzky and second guitarist James Iha.  Led by the single "Bullet with Butterfly Wings", the record debuted at number one on the Billboard charts, the only such occurrence for the group. The album spawned five more singles—"1979", "Zero", "Tonight, Tonight", the promotional "Muzzle", and "Thirty-Three"—over the course of 1996, and has been certified diamond by the RIAA. Praised by critics for its ambition and scope, Mellon Collie and the Infinite Sadness earned the band seven Grammy Award nominations in 1997, including Album of the Year and Record of the Year ("1979").', './Images/AlbumImages/Melloncollieandtheinfinitesadness.jpg', 8),
(17, 'Heritage', '2011-09-14', 'Heritage is the tenth studio album by Swedish band Opeth, released on 14 September 2011 through Roadrunner Records. The album was recorded in early 2011 at Atlantis/Metronome Studios in Stockholm and produced by Mikael Åkerfeldt, engineered by Janne Hansson, and mixed by Steven Wilson. A critical and commercial success, the album sold 19,000 units in the United States in its debut week, charting at number 19 on the Billboard 200. The album signals a departure from the musical style of Opeth''s past albums, being one of only two albums by the band not to feature death growls (the other being Damnation).', './Images/AlbumImages/Heritage.jpg', 9),
(18, 'OK Computer', '1997-05-21', 'OK Computer is the third studio album by the English alternative rock band Radiohead, released in 1997 on Parlophone and Capitol Records. OK Computer was the first self-produced Radiohead album, with assistance from Nigel Godrich. Radiohead recorded the album in Oxfordshire and Bath between 1996 and early 1997, with most of the recording completed in the historic mansion St. Catherine''s Court. The band made a deliberate attempt to distance themselves from the guitar-oriented, lyrically introspective style of their previous album, The Bends. OK Computer''s abstract lyrics, densely layered sound and wide range of influences laid the groundwork for Radiohead''s later, more experimental work.  Upon the album''s delivery to Capitol, label representatives lowered their sales estimates, deeming the record uncommercial. Nevertheless, OK Computer reached number one on the UK Albums Chart and became the band''s highest album entry on the American charts at the time, debuting at number 21 on the Billboard 200. Three songs from the album—"Paranoid Android", "Karma Police" and "No Surprises"—were released as promotional singles. The album expanded Radiohead''s worldwide popularity and has sold over three million copies to date.  OK Computer received considerable acclaim upon release. Prominent British and American rock critics predicted the album would have far-reaching cultural impact. In subsequent years, the album has been frequently cited by listeners, critics and musicians as one of the greatest of its time. OK Computer initiated a shift away from the popular Britpop genre of the time to the more melancholic and atmospheric style of alternative rock that would be prevalent in the next decade. Critics and fans often comment on the underlying themes found in the lyrics and artwork, emphasising Radiohead''s views on rampant consumerism, social alienation and political malaise; in this capacity, OK Computer is often interpreted as having prescient insight into the mood of 21st century life.', './Images/AlbumImages/Okcomputer.jpg', 10),
(19, 'Still Life', '1999-10-18', 'Still Life is the fourth studio album by Swedish progressive death metal band Opeth. The album was produced and engineered by Opeth alongside Fredrik Nordström, and released on October 18, 1999 through Peaceville Records. It was the first Opeth album to be released through Peaceville, following their departure from Candlelight and Century Black after the release of My Arms, Your Hearse.', './Images/AlbumImages/Stilllife.jpg', 9),
(20, 'Blackwater Park', '2001-02-27', 'Blackwater Park is the fifth studio album by Swedish progressive death metal band Opeth. It was released on February 27, 2001 through Music for Nations and Koch Records. The album marks the first collaboration between Porcupine Tree frontman Steven Wilson and the band, as Wilson had been brought in to produce the album, which led to a considerable shift in Opeth''s musical style.  Blackwater Park did not chart in North America or the United Kingdom. The album had two singles released from it: "The Drapery Falls" and "Still Day Beneath the Sun". Blackwater Park was highly acclaimed on its initial release and has been praised by critics, with Eduardo Rivadavia of Allmusic stating that the album is "surely the band''s coming-of-age album, and therefore, an ideal introduction to its remarkable body of work."', './Images/AlbumImages/Blackwaterpark.jpg', 9);
INSERT INTO `artist` (`artistid`, `artistname`, `artistdescription`) VALUES
(1, 'The Smiths', 'The Smiths were an English alternative rock band, formed in Manchester in 1982. Based on the song writing partnership of vocalist Morrissey and guitarist Johnny Marr, the band also included bassist Andy Rourke and drummer Mike Joyce. Critics have called them the most important alternative rock band to emerge from the British independent music scene of the 1980s. The group was signed to the independent record label Rough Trade Records, on which they released four studio albums, several compilations, and numerous non-LP singles. Although they had limited commercial success outside the UK while they were still together, and never released a single that charted higher than number 10 in their home country, The Smiths won a significant following, and remain cult and commercial favourites. The band broke up in 1987 and have turned down several offers to reunite.'),
(2, 'The Cure', 'The Cure are an English rock band formed in Crawley, West Sussex in 1976. The band has experienced several line-up changes, with frontman, vocalist, guitarist and principal songwriter Robert Smith being the only constant member. The Cure first began releasing music in the late 1970s with its debut album Three Imaginary Boys (1979); this, along with several early singles, placed the band as part of the post-punk and New Wave movements that had sprung up in the wake of the punk rock revolution in the United Kingdom. During the early 1980s, the band''s increasingly dark and tormented music helped form the gothic rock genre. After the release of Pornography (1982), the band''s future was uncertain and Smith was keen to move past the gloomy reputation his band had acquired. With the 1982 single "Let''s Go to Bed" Smith began to place a pop sensibility into the band''s music (as well as a unique stage look). The Cure''s popularity increased as the decade wore on, especially in the United States where the songs "Just Like Heaven", "Lovesong" and "Friday I''m in Love" entered the Billboard Hot 100 chart. By the start of the 1990s, The Cure were one of the most popular alternative rock bands in the world. The band is estimated to have sold 27 million albums as of 2004. The Cure have released thirteen studio albums, 10 EPs and over thirty singles during the course of their career. Since 2010, they have been working on a fourteenth studio album.'),
(3, 'Pearl Jam', 'Pearl Jam is an American rock band that formed in Seattle, Washington, in 1990. Since its inception, the band''s line-up has included Eddie Vedder (vocals), Stone Gossard (guitar), Jeff Ament (bass), and Mike McCready (guitar). The band''s current drummer is Matt Cameron, also of Soundgarden, who has been with the band since 1998.  Formed after the demise of Gossard and Ament''s previous band, Mother Love Bone, Pearl Jam broke into the mainstream with its debut album, Ten. One of the key bands of the grunge movement in the early 1990s, Pearl Jam was criticized early on as being a corporate cash-in on the alternative rock explosion. However, over the course of the band''s career, its members became noted for their refusal to adhere to traditional music industry practices, including refusing to make music videos and engaging in a much-publicized boycott of Ticketmaster. In 2006, Rolling Stone described the band as having "spent much of the past decade deliberately tearing apart their own fame." To date, the band has sold over 31.5 million records in the U.S, and an estimated 60 million worldwide. Pearl Jam has outlasted many of its contemporaries from the alternative rock breakthrough of the early 1990s, and is considered one of the most influential bands of the decade. Stephen Thomas Erlewine of Allmusic referred to Pearl Jam as "the most popular American rock & roll band of the ''90s."'),
(4, 'Nirvana', 'Nirvana was an American rock band that was formed by singer/guitarist Kurt Cobain and bassist Krist Novoselic in Aberdeen, Washington in 1987. Nirvana went through a succession of drummers, the longest-lasting being Dave Grohl, who joined the band in 1990.  In the late 1980s Nirvana established itself as part of the Seattle grunge scene, releasing its first album Bleach for the independent record label Sub Pop in 1989. The band eventually came to develop a sound that relied on dynamic contrasts, often between quiet verses and loud, heavy choruses. After signing to major label DGC Records, Nirvana found unexpected success with "Smells Like Teen Spirit", the first single from the band''s second album Nevermind (1991). Nirvana''s sudden success widely popularized alternative rock as a whole, and the band''s frontman Cobain found himself referred to in the media as the "spokesman of a generation", with Nirvana being considered the "flagship band" of Generation X. Nirvana''s third studio album, In Utero (1993), featured an abrasive, less-mainstream sound and challenged the group''s audience. The album did not match the sales figures of Nevermind but was still a commercial success.  Nirvana''s brief run ended following the death of Kurt Cobain in 1994, but various posthumous releases have been issued since, overseen by Novoselic, Grohl, and Cobain''s widow Courtney Love. Since its debut, the band has sold over 25 million records in the United States alone, and over 75 million records worldwide.'),
(5, 'Stone Temple Pilots', 'Stone Temple Pilots (often abbreviated to STP) is an American rock band from San Diego, California that consists of Scott Weiland (lead vocals), brothers Robert DeLeo (bass guitar, vocals) and Dean DeLeo (guitar), and Eric Kretz (drums, percussion).  After forming in 1986 under the name Mighty Joe Young, the band signed with Atlantic Records and was forced to change its name to Stone Temple Pilots. STP found immediate success in 1993 after releasing their debut album Core (1992), and went on to become one of the most commercially successful bands of the 1990s. The band released four more studio albums: Purple (1994), Tiny Music... Songs from the Vatican Gift Shop (1996), No. 4 (1999) and Shangri-La Dee Da (2001) before separating in 2003, after which the band members partook in various projects, most notably Velvet Revolver and Army of Anyone. STP eventually reconvened in 2008 for a reunion tour, released a new self-titled album in 2010, and have been actively touring since.  While initially displaying a sound typically identified as grunge early on in its career, further releases from the band have shown a variety of influences, including psychedelic rock, bossa nova and classic rock. The band''s evolution throughout the 1990s and early 2000s involved several tumultuous periods of commercial highs and lows, brought about in part by Weiland''s well-publicized struggles with drug addiction.'),
(6, 'Soundgarden', 'Soundgarden is an American rock band formed in Seattle, Washington in 1984 by singer and rhythm guitarist Chris Cornell, lead guitarist Kim Thayil, and bassist Hiro Yamamoto. Matt Cameron became the band''s full-time drummer in 1986, while bassist Ben Shepherd became a permanent replacement for Yamamoto in 1990.  Soundgarden was one of the seminal bands in the creation of grunge, a style of alternative rock that developed in Seattle, and was one of a number of grunge bands signed to the record label Sub Pop. Soundgarden was the first grunge band to sign to a major label (A&M Records, in 1988), though the band did not achieve commercial success until they popularized the genre in the early 1990s with Seattle contemporaries Nirvana, Alice in Chains, and Pearl Jam.  Soundgarden achieved its biggest success with the 1994 album Superunknown, which debuted at number one on the Billboard charts and yielded the Grammy Award-winning singles "Black Hole Sun" and "Spoonman". In 1997, the band broke up due to internal strife over its creative direction. After several years working on projects and other bands, Soundgarden reunited in 2010 and their sixth studio album, King Animal, was released two years later. As of 2012, Soundgarden had sold over 10.5 million records in the United States, and an estimated 22.5 million worldwide.'),
(7, 'Pixies', 'The Pixies are an American alternative rock band formed in Boston, Massachusetts in 1986. The group consists of Black Francis (vocals, rhythm guitar), Joey Santiago (lead guitar), Kim Deal (bass, vocals), and David Lovering (drums). The Pixies achieved relatively modest commercial success in their home country, but were significantly more successful in the United Kingdom and mainland Europe. The group disbanded in 1993 under acrimonious circumstances, but reunited in 2004.  The band''s style of music contains a range of elements, including indie rock, psychedelia, noise rock, and surf rock. Black Francis is the Pixies'' primary songwriter and singer. He has written about a number of offbeat subjects in the band''s songs, such as extraterrestrials, surrealism, incest, and biblical violence.  The group is credited as being a big influence on the alternative rock boom of the 1990s. The Pixies'' legacy and popularity grew in the years following their break-up, leading to sold-out world tours following their reunion in 2004.'),
(8, 'Smashing Pumpkins', 'Smashing Pumpkins is an American alternative rock band from Chicago, Illinois, formed in 1988. Formed by frontman Billy Corgan (lead vocals, lead guitar) and James Iha (rhythm guitar), the band has included Jimmy Chamberlin (drums), D''arcy Wretzky (bass guitar), Melissa Auf der Maur (bass guitar), and currently includes Mike Byrne (drums), Nicole Fiorentino (bass guitar, backing vocals), and Jeff Schroeder (rhythm guitar) among its membership.  Disavowing the punk rock roots of many of their alt-rock contemporaries, the Pumpkins have a diverse, densely layered, and guitar-heavy sound, containing elements of gothic rock, heavy metal, dream pop, psychedelic rock, progressive rock, shoegazing-style production, and, in later recordings, electronica. Corgan is the group''s primary songwriter—his grand musical ambitions and cathartic lyrics have shaped the band''s albums and songs, which have been described as "anguished, bruised reports from Billy Corgan''s nightmare-land". The Smashing Pumpkins broke into the musical mainstream with their second album, 1993''s Siamese Dream. The group built its audience with extensive touring and their 1995 follow-up, the double album Mellon Collie and the Infinite Sadness, which debuted at number one on the Billboard 200 album chart. With 19.75 million albums sold in the United States, The Smashing Pumpkins were one of the most commercially successful and critically acclaimed bands of the 1990s. However, internal fighting, drug use, and diminishing record sales led to a 2000 break-up.  In 2006, Billy Corgan and Jimmy Chamberlin reconvened to record a new Smashing Pumpkins album, Zeitgeist. The band toured with a rotating lineup of between five and nine musicians through much of 2007 and 2008 with new member Jeff Schroeder before Chamberlin left the band in early 2009. New drummer Mike Byrne and bassist Nicole Fiorentino solidified a new lineup with Corgan and Schroeder, toured through much of 2010 and 2011, and are currently recording the album Teargarden by Kaleidyscope, having just released the album-within-an-album Oceania.'),
(9, 'Opeth', 'Opeth is a Swedish heavy metal band from Stockholm, formed in 1990. Though the group has been through several personnel changes, singer, guitarist, and songwriter Mikael Åkerfeldt has remained Opeth''s driving force throughout the years. Opeth has consistently incorporated progressive, folk, blues, classical and jazz influences into their usually lengthy compositions, as well as noticeable influences from black metal and death metal, most notably in their early works. Many songs include acoustic guitar passages and strong dynamic shifts, as well as both death growls and clean vocals. Opeth rarely made live appearances supporting their first four albums; but since conducting their first world tour after the 2001 release of Blackwater Park, they have led several major world tours.  Opeth has released ten studio albums, three live DVDs, three live albums (two that are in conjunction with DVDs), and two boxsets. The band released its debut album Orchid in 1995. Although their eighth studio album, Ghost Reveries, was quite popular in the United States, Opeth did not experience major American commercial success until the 2008 release of their ninth studio album, Watershed, which peaked at number twenty-three on the Billboard 200, and topped the Finnish albums chart in its first week of release. Opeth has sold over 2 million albums and DVDs worldwide, including 300,000 collective Soundscans of their albums Blackwater Park, Damnation and Deliverance in the United States.'),
(10, 'Radiohead', 'Radiohead are an English rock band from Abingdon, Oxfordshire, formed in 1985. The band consists of Thom Yorke (lead vocals, guitar, piano), Jonny Greenwood (lead guitar, keyboards, other instruments), Colin Greenwood (bass), Phil Selway (drums, percussion) and Ed O''Brien (guitar, backing vocals).  Radiohead released their debut single "Creep" in 1992. The song was initially unsuccessful, but it became a worldwide hit several months after the release of their debut album, Pablo Honey (1993). Radiohead''s popularity rose in the United Kingdom with the release of their second album, The Bends (1995). Radiohead''s third album, OK Computer (1997), propelled them to greater international fame. Featuring an expansive sound and themes of modern alienation, OK Computer is often acclaimed as one of the landmark records of the 1990s.  Kid A (2000) and Amnesiac (2001) marked an evolution in Radiohead''s musical style, as the group incorporated experimental electronic music, krautrock and jazz influences. Kid A, though somewhat polarising at the time of its release, is now frequently recognised as one of the most important albums of the 2000s. Hail to the Thief (2003), a mix of piano and guitar driven rock, electronics and lyrics inspired by war, was the band''s final album for their major record label, EMI. Radiohead self-released their seventh album, In Rainbows (2007), as a digital download for which customers could set their own price, and later in physical form to critical and chart success. Radiohead''s eighth album, The King of Limbs (2011), was an exploration of rhythm and quieter textures, which the band released independently.  Radiohead have sold more than 30 million albums worldwide, with the band''s work being placed highly in both listener polls and critics'' lists, they have the distinction of doing so in both the 1990s and 2000s. In 2005, Radiohead were ranked number 73 in Rolling Stone''s list of "The Greatest Artists of All Time", while Jonny Greenwood and Ed O''Brien were both included in Rolling Stone''s list of greatest guitarists, and Thom Yorke in their list of greatest singers. In 2009, Rolling Stone readers voted the group the second best artist of the 2000s.');
