INSERT INTO `track` (`trackid`, `trackname`, `trackdescription`, `albumid`, `artistid`) VALUES
(1, 'Smells Like Teen Spirit', '"Smells Like Teen Spirit" is a song by the American rock band Nirvana. It is the opening track and lead single from the band''s second album, Nevermind (1991), released on DGC Records. Written by Kurt Cobain, Krist Novoselic, and Dave Grohl and produced by Butch Vig, the song uses a verse-chorus form where the main four-chord riff is used during the intro and chorus to create an alternating loud and quiet dynamic.  The unexpected success of "Smells Like Teen Spirit" in late 1991 propelled Nevermind to the top of the charts at the start of 1992, an event often marked as the point where alternative rock entered the mainstream. "Smells Like Teen Spirit" was Nirvana''s biggest hit, reaching number six on the Billboard Hot 100 and placing high on music industry charts all around the world in 1991 and 1992.  "Smells Like Teen Spirit" received many critical plaudits, including topping the Village Voice Pazz & Jop critics'' poll and winning two MTV Video Music Awards for its music video, which was in heavy rotation on music television. The song was dubbed an "anthem for apathetic kids" of Generation X,[2][3] but the band grew uncomfortable with the success and attention it received as a result. In the years since Cobain''s death, listeners and critics have continued to praise "Smells Like Teen Spirit" as one of the greatest rock songs of all time.', 1, 4),
(2, 'Come as You Are', '"Come as You Are" is a song by the American grunge band Nirvana, written by frontman Kurt Cobain and released as the second single from the band''s second studio album Nevermind in 1992. It was the band''s second American Top 40 hit, and second UK top 10 hit, reaching number 32 on the Billboard Hot 100, and number nine on the UK Singles Chart. The music video for "Come as You Are" was directed by Kevin Kerslake, who drew inspiration for it from the cover artwork of Nevermind.', 1, 4),
(3, 'Lithium', '"Lithium" is a song by the American grunge band Nirvana, written by frontman Kurt Cobain. Veering between quiet verses and loud choruses, "Lithium" is about a man who turns to religion amid thoughts of suicide. Nirvana first recorded "Lithium" in 1990 with producer Butch Vig, then re-recorded the song with Vig the following year for the group''s second album Nevermind (1991).  Released as the third single from Nevermind in July 1992, "Lithium" peaked at number 64 on the US Billboard Hot 100 and number 11 on the UK Singles Chart. The accompanying music video, directed by Kevin Kerslake, is a montage of concert footage.', 1, 4),
(4, 'In Bloom', '"In Bloom" is a song by the American grunge band Nirvana. Written by frontman Kurt Cobain, the song addresses people outside of the underground music community who did not understand the band''s message.  Nirvana made its first music video for an early version of "In Bloom" in 1990; however the song did not appear on a commercial release until the release of the group''s second album, Nevermind, in 1991. "In Bloom" became the fourth and final single from the album in late 1992. It was accompanied by a new music video which parodied musical performances of 1960s variety shows.', 1, 4),
(5, 'Heart-Shaped Box', '"Heart-Shaped Box" is a song by the American grunge band Nirvana, written by vocalist and guitarist Kurt Cobain. The song was released as the first single from the group''s third and final studio album, In Utero, in 1993. It was one of two songs from the album mixed by Scott Litt in order to augment the original production by producer Steve Albini. While Nirvana''s label DGC Records did not release a physical single for sale in the United States, "Heart-Shaped Box" received much American radio airplay, reaching number one on the Billboard Modern Rock Tracks chart. The international release of the single reached number five on the UK Singles Chart. The song''s music video, directed by Anton Corbijn, garnered critical plaudits.', 2, 4),
(6, 'All Apologies', '"All Apologies" is a song by the American grunge band Nirvana, written by frontman Kurt Cobain. It was released as the second single from the band''s third album, In Utero, which was released on September 21, 1993. It was released as a double A-side with the song "Rape Me". "All Apologies" was the band''s third number one Modern Rock hit and reached number 32 on the UK Singles Chart.', 2, 4),
(7, 'Rape Me', '"Rape Me" is a song by the American grunge band Nirvana, written by frontman Kurt Cobain. The song was released as the second single from Nirvana''s third album In Utero in 1993, packaged as a double A-side along with "All Apologies". The single reached number 32 on the UK Singles Chart.', 2, 4),
(8, 'Blew', '"Blew" was written in 1988 by Nirvana frontman Kurt Cobain. The song was recorded in December 1988 and initially appeared as the first track on Nirvana''s 1989 debut album Bleach.', 3, 4),
(9, 'About a Girl', '"About a Girl" is a song by the American grunge band, Nirvana. It is the third song on the group''s debut album, Bleach (1989). It is also the first song on the posthumous MTV Unplugged in New York album from which it was a single in 1994.', 3, 4),
(10, 'Negative Creep', '"Negative Creep" is a song by the American grunge band Nirvana from its 1989 debut album Bleach. The song was written by Kurt Cobain about himself, and how he claimed that he always saw himself as a negative person. It was named as one of the "Sub Popiest" grunge songs the band ever recorded. IGN called it "a textbook example of Seattle''s true grunge sound... featuring Cobain''s frantic wails and screaming on top of a repetitious and heavy grunge riff." The song has been also been described as "creepy" which works quite well with the title. "Negative Creep" is the only song on Bleach (including the reissued tracks), that does not end abruptly. Instead it fades out with the vocals, giving it a 60s pop aesthetic. The line "Daddy''s little girl ain''t a girl no more" shares similarities to Mudhoney''s "Sweet Young Thing Ain''t Sweet No More" from Superfuzz Bigmuff. Nirvana does not credit the song and the line was under the speculation of plagiarism. Some reviewers instead see the songs as an ode, not a ripoff, such as "Smells Like Teen Spirit" being an ode to Pixies'' Debaser.', 3, 4),
(11, 'Killing an Arab', '"Killing an Arab" is the first single by The Cure. It was recorded at the same time as their first LP in the UK, Three Imaginary Boys (1979) but not included on the album. However it was included on the band''s first US album, Boys Don''t Cry (1980).', 4, 2),
(12, 'Boy''s Don''t Cry', '"Boys Don''t Cry" was the second single to be released by The Cure, released in June 1979. It was released in the UK as a stand-alone single, and was included as the title track on Boys Don''t Cry, the American equivalent to Three Imaginary Boys.', 4, 2),
(13, 'Jumping Someone Else''s Train', '"Jumping Someone Else''s Train" is a single by The Cure. The song was covered by the Brooklyn-based band "Luff" for the 2008 American Laundromat Records tribute album Just Like Heaven - A Tribute to The Cure and by Army Navy on Manimal Vinyl''s tribute Perfect as Cats: A Tribute to The Cure.', 4, 2),
(14, 'In Between Days', '"In Between Days" (sometimes listed as "Inbetween Days" or "In-Between Days") is a song by the English new wave/rock band The Cure.  The song was released as the first single from the band''s 1985 album The Head on the Door and was a big international success. In the UK, it was the band''s ninth chart single and their fourth consecutive Top 20 hit; while in the US it was their first single to reach the Billboard Hot 100 when it peaked at #99. It was a Top 20 hit in Australia and New Zealand and also charted in several European countries, increasing the popularity of the band.  The song is poppy and upbeat, featuring strummed acoustic guitars under a snappy synthesizer riff, although the song''s lyrical themes of ageing, loss and fear do not particularly reflect the upbeat tempo of the music. The extended version, only released on the 12" single in North America, features quite a longer introduction to the song.', 5, 2),
(15, 'Close to Me', '"Close to Me" is a song by English rock group The Cure from their album The Head on the Door. On its original release, the single was most successful in Ireland, peaking at #4, also reaching #7 in Australia. It was remixed in 1990, which itself was released as a single, peaking at #13 on the UK singles chart and #97 on the Billboard Hot 100 chart in the US in January 1991.', 5, 2),
(16, 'Lullaby', '"Lullaby" is a 1989 single by The Cure from their album Disintegration.', 6, 2),
(17, 'Fascination Street', '"Fascination Street" is a 1989 U.S.-only single by the rock band The Cure from their album Disintegration.  Their American record company refused the band''s original choice "Lullaby" as the first single (it was the lead single in the UK and was released in the U.S. later) and used "Fascination Street" instead. The song is notable for its extended bass introduction.  The song became the band''s first number-one single on Billboard''s then-newly-created Modern Rock Tracks chart, where it stayed on top for seven weeks.  An extended mix was also produced, notable in which the lyrics begin after a 4:00 instrumental intro.  The song is a playable track in Guitar Hero: Warriors of Rock. ', 6, 2),
(18, 'Lovesong', '"Lovesong" (sometimes listed as "Love Song") is a song originally recorded by the English alternative rock band The Cure, released as the third single from their eighth studio album Disintegration in 1989. The song saw considerable success in the United States, where it was a #2 hit and the band''s only top ten entry on the Billboard Hot 100; in the United Kingdom, the single charted at #18.  Though the song has been covered by several artists, the most famous and successful cover is the 2004 version by American reggae rock band 311, recorded for the soundtrack for the film 50 First Dates and also released as a single. This version actually charted higher on the U.S. Modern Rock Tracks chart (reaching #1) than the Cure original (which peaked at #2). This song was also performed by Adele on her 2011 album 21.', 6, 2),
(19, 'Pictures of You', '"Pictures of You" is the fourth and final single from the British rock band The Cure''s 1989 album Disintegration. The single version is a remix edit of the album version, and at 4:48 minutes is significantly shorter than the original album version which runs for 7:24. There are also two different remixes on two UK 12" singles, and other singles released around the world, one of which later appeared on Mixed Up as the Extended Dub Mix and differs significantly from the album version in arrangement in that incorporates wholly original drum and bass arrangements. The other is an extended remix of the original album version which, at 7:59, runs slightly longer than the album version. There is also an edit which was released on 12" in the US, titled "extended remix" as in the European and Australasian releases, but which runs for 6:40 rather than 7:59.  According to interviews, the inspiration of the song came when a fire broke loose in Robert Smith''s home. After that day, Smith was going through the remains and came across his wallet which had pictures of his wife, Mary. The cover of the single is one of the pictures. The same picture was used as the cover of the "Charlotte Sometimes" single, but that version was heavily warped and distorted.  In 2003, Hewlett-Packard used the song in a commercial for digital photography products.  In 2004, the song was voted 278th on Rolling Stone''s "The 500 Greatest Songs of All Time" list.  A cover of the song is featured on Lit''s 2004 self-titled album. It is also featured in the 2007 documentary, The King of Kong.  In 2008, a cover version by Angie Hart, was used for a Victorian (Australia) government campaign to combat speeding drivers. In 2009, the song was featured on One Tree Hill''s episode "A Kiss To Build A Dream On", where Peyton and Lucas embark on a road trip to see The Cure live in concert.  In 2012, the song appeared in the closing scene of the film, The Vow.', 6, 2),
(20, 'Alive', '"Alive" is a song by the American rock band Pearl Jam. "Alive" was Pearl Jam''s first single, and appeared on the band''s debut album, Ten (1991). Written by guitarist Stone Gossard, "Alive" originated as an instrumental titled "Dollar Short" and was included on a demo tape circulated in hopes of finding a singer for the group. Vocalist Eddie Vedder obtained a copy of the tape and wrote lyrics that describe a fictionalized account (though somewhat based on Vedder''s personal experience) of the time when he was told that the man he thought was his father was not actually his biological parent. "Alive" charted at number 16 in the UK (the single was available only through import in the US). Remixed versions of the song were included on Pearl Jam''s 2004 greatest hits album, rearviewmirror (Greatest Hits 1991–2003), and the 2009 Ten reissue. The song peaked at number 16 on the Billboard Mainstream Rock Tracks chart.', 7, 3),
(21, 'Even Flow', '"Even Flow" is a song by the American rock band Pearl Jam. Featuring lyrics written by vocalist Eddie Vedder and music written by guitarist Stone Gossard, "Even Flow" was released in 1992 as the second single from the band''s debut album, Ten (1991). The song peaked at number three on the Billboard Mainstream Rock Tracks chart. The song was included on Pearl Jam''s 2004 greatest hits album, rearviewmirror (Greatest Hits 1991–2003). A remixed version of the song was included on the 2009 Ten reissue.', 7, 3),
(22, 'Jeremy', '"Jeremy" is a song by the American rock band Pearl Jam, with lyrics written by vocalist Eddie Vedder and music written by bassist Jeff Ament. "Jeremy" was released in 1992 as the third single from Pearl Jam''s debut album Ten (1991). The song was inspired by a newspaper article Vedder read about a high school student who killed himself in front of his classmates. It reached the number five spot on both the Mainstream and Modern Rock Billboard charts. It did not originally chart on the regular Billboard Hot 100 singles chart since it was not released as a commercial single in the U.S. at the time, but a re-release in July 1995 brought it up to number 79. The song gained notoriety for its music video, directed by Mark Pellington and released in 1992, which received heavy rotation by MTV and became a hit. In 1993, the "Jeremy" video was awarded four MTV Video Music Awards, including Best Video of the Year.', 7, 3),
(23, 'Oceans', '"Oceans" is a song by the American rock band Pearl Jam. Featuring lyrics written by vocalist Eddie Vedder and music co-written by Vedder, guitarist Stone Gossard, and bassist Jeff Ament, "Oceans" was released in 1992 as the fourth single from the band''s debut album, Ten (1991). Remixed versions of the song can be found on the "Even Flow" single and the 2009 Ten reissue.', 7, 3),
(24, 'Go', '"Go" is a song by the American rock band Pearl Jam, released in 1993 as the first single from the band''s second studio album, Vs. (1993). Although credited to all members of Pearl Jam, it features lyrics written by vocalist Eddie Vedder and music primarily written by drummer Dave Abbruzzese. The song peaked at number three on the Billboard Mainstream Rock Tracks chart. The song was included on Pearl Jam''s 2004 greatest hits album, rearviewmirror (Greatest Hits 1991–2003).', 8, 3),
(25, 'Daughter', '"Daughter" is a song by the American rock band Pearl Jam, released in 1993 as the second single from the band''s second studio album, Vs. (1993). Although credited to all members of Pearl Jam, it features lyrics written by vocalist Eddie Vedder and music primarily written by guitarist Stone Gossard. The song topped both the Mainstream Rock and Modern Rock Billboard charts. The song spent a total of eight weeks at number one on the Mainstream Rock chart. "Daughter" eventually peaked at number 28 on the Top 40 Mainstream chart, becoming the band''s first Top 40 single. The song was included on Pearl Jam''s 2004 greatest hits album, rearviewmirror (Greatest Hits 1991–2003).', 8, 3),
(26, 'Animal', '"Animal" is a song by the American rock band Pearl Jam, released in 1994 as the third single from the band''s second studio album, Vs. (1993). Although credited to all members of Pearl Jam, it features lyrics written by vocalist Eddie Vedder and music primarily written by guitarist Stone Gossard. The song peaked at number 21 on the Billboard Mainstream Rock Tracks chart. The song was included on Pearl Jam''s 2004 greatest hits album, rearviewmirror (Greatest Hits 1991–2003).', 8, 3),
(27, 'Dissident', '"Dissident" is a song by the American rock band Pearl Jam, released in 1994 as the fourth single from the band''s second studio album, Vs. (1993). The song peaked at number three on the Billboard Mainstream Rock Tracks chart. The song was included on Pearl Jam''s 2004 greatest hits album, rearviewmirror (Greatest Hits 1991–2003).', 8, 3),
(28, 'What Difference Does It Make?', '"What Difference Does It Make?" is a 1984 single by British band The Smiths. The single version can be found on the band''s self-titled debut album The Smiths. A different version recorded for the John Peel Show on BBC Radio One is featured on the compilation album Hatful of Hollow.', 10, 1),
(29, 'William, It Was Really Nothing', '"William, It Was Really Nothing" is a song by British band The Smiths. It was released as a single on 24 August 1984, featuring the B-sides "Please, Please, Please, Let Me Get What I Want" and "How Soon Is Now?", and reached number 17 in the UK Singles Chart. The song is featured on the compilation albums Hatful of Hollow and Louder Than Bombs as well as other best of and singles collections. In 2004 the song was ranked number 425 on Rolling Stone magazine''s list of the 500 greatest songs of all time.  The original artwork depicted comes from an early 80s advertisement for A.D.S. speakers (the object on the bed is a speaker), however due to legal reasons later pressings were produced with new artwork, a lilac-tinted still of Billie Whitelaw from the film Charlie Bubbles, directed by Albert Finney. The sleeve for the 1988 CD single reissue shows Colin Campbell from the 1964 film The Leather Boys. This artwork had previously been used in Germany for the single "Ask".  When the band performed the song on Top of the Pops, Morrissey ripped open his shirt to reveal the words "MARRY ME" written on his chest ("Would you like to marry me?" is one line of the song).', 9, 1),
(30, 'This Charming Man', '"This Charming Man" is a song by the English band The Smiths, written by guitarist Johnny Marr and singer/lyricist Morrissey. It was released as the group''s second single in October 1983 on the independent record label Rough Trade. The song is defined by Marr''s jangle pop guitar riff and Morrissey''s characteristically morose lyrics, which revolve around the recurrent Smiths themes of sexual ambiguity and lust. Feeling detached from and unable to relate to the early 1980s mainstream gay culture, Morrissey wrote "This Charming Man" to evoke an older, more coded and self-aware underground scene. The singer explained of the song''s lyrics, "I really like the idea of the male voice being quite vulnerable, of it being taken and slightly manipulated, rather than there being always this heavy machismo thing that just bores everybody." Although only moderately successful on first release—the single peaked at number 25 on the British singles chart—"This Charming Man" has been widely praised in both the music and mainstream press. The single was re-issued in 1992, reaching number 8 on the UK singles chart (making it The Smiths'' biggest UK hit by chart position). In 2004, BBC Radio 2 listeners voted it number 97 on the station''s "Sold On Song Top 100" poll. Mojo magazine journalists placed the track at number one on their 2008 "50 Greatest UK Indie Records of All Time" feature.', 9, 1),
(31, 'How Soon Is Now?', '"How Soon Is Now?" is a song by the British alternative rock band The Smiths. Written by Smiths singer Morrissey and guitarist Johnny Marr, it was originally a B-side of the 1984 single "William, It Was Really Nothing". "How Soon Is Now?" was subsequently featured on the compilation album Hatful of Hollow and on U.S., Canadian, Australian and Warner UK editions of the group''s second album Meat Is Murder (1985). It was belatedly released as a single in the UK in 1985, where it reached number 24 on the UK Singles Chart.  Sire Records chief Seymour Stein called it "the ''Stairway to Heaven'' of the Eighties", while co-writer Johnny Marr described it as "possibly our most enduring record. It''s most people''s favourite, I think." Despite its prominent place in The Smiths'' repertoire, however, it is not generally considered to be representative of the band''s style. Although a club favourite, "How Soon Is Now?" did not chart as well as expected. Most commentators put this down to the fact that the song had been out on vinyl in a number of forms before being released as a single in its own right. The original track runs for nearly seven minutes; however, the 7" single edit cut the length down to under four minutes. The complete version is generally used on compilations. The song has been widely praised for, among other things, the artistry of its lyrics. A cover of the song by Love Spit Love was used in the soundtrack for the 1996 film The Craft, as well as the film "The Crow" and later appeared as the theme song of the television series Charmed for all eight of its seasons. The song briefly made an appearance in the 4th episode of BBC''s show Inside the Human Body.  The song''s title was inspired by a line in Popcorn Venus: Women, Movies and the American Dream by Marjorie Rosen, which Morrissey picked as one of his favourite books in NME in 1983', 9, 1),
(32, 'Heaven Knows I''m Miserable Now', ' Jump to: navigation, search "Heaven Knows I''m Miserable Now" Single by The Smiths B-side 	"Suffer Little Children" "Girl Afraid" Released 	21 May 1984 (CD single: 28 November 1988) Format 	7" vinyl, 12" vinyl, CD Recorded 	March 1984 Fallout Shelter, Hammersmith, London[1] Genre 	Alternative rock, indie pop, indie rock Length 	3:35 Label 	Rough Trade Writer(s) 	Johnny Marr Morrissey Producer 	John Porter The Smiths singles chronology "What Difference Does It Make?" (1984) 	"Heaven Knows I''m Miserable Now" (1984) 	"William, It Was Really Nothing" (1984) Professional ratings Review scores Source 	Rating Allmusic 	3/5 stars[2]  "Heaven Knows I''m Miserable Now" is a single by The Smiths that reached #10 on the UK Singles Chart in June 1984 before its inclusion on the compilation album, Hatful of Hollow. It is listed as one of the Rock and Roll Hall of Fame''s 500 Songs that Shaped Rock and Roll.', 9, 1),
(33, 'Sex Type Thing', '"Sex Type Thing" is the debut single released in 1992 by American rock band Stone Temple Pilots from their debut studio album, Core. "Sex Type Thing" also appears on the greatest hits compilation album Thank You. The song spawned a music video which received moderate rotation on MTV (at the height of the early 1990s grunge music scene). The single peaked at number 23 on the US Modern Rock chart.', 11, 5),
(34, 'Plush', '"Plush" is a song by American rock band Stone Temple Pilots. It is one of the band''s biggest hits, and was released as the second single from the band''s debut studio album, Core (1992).', 11, 5),
(35, 'Wicked Garden', ' Jump to: navigation, search "Wicked Garden" Single by Stone Temple Pilots from the album Core Released 	September 29, 1992 June 1993 (re-release) Format 	CD single, Cassette, vinyl Recorded 	1992 Genre 	Grunge, hard rock, alternative metal Length 	4:05 Label 	Atlantic Writer(s) 	Music: Robert DeLeo, Dean DeLeo Lyrics: Scott Weiland Producer 	Brendan O''Brien Music sample "Wicked Garden" Menu Music video "Wicked Garden" on YouTube  "Wicked Garden" is a song by the American rock band Stone Temple Pilots that appears on their debut studio album, Core. The song was never released as a commercial single (only as a radio promo) but is still considered to be one of the band''s biggest hits and appears on their greatest hits compilation, Thank You. The song''s lyrics were written by Scott Weiland and the music was written by brothers Robert and Dean DeLeo.', 11, 5),
(36, 'Creep', '"Creep" is a song by American rock band Stone Temple Pilots, appearing as the seventh track off the band''s debut album, Core and later released as a single. The song also appears on the band''s greatest hits album, Thank You.', 11, 5),
(37, 'Big Empty', '"Big Empty" is a song by the American hard rock band Stone Temple Pilots that first appeared in 1994 on the soundtrack to the Brandon Lee movie The Crow. The song later appeared on the band''s second album, Purple. The song was released as a successful single, reaching #3 and #7 on the Billboard Mainstream Rock Tracks and Modern Rock Tracks charts, respectively. The song is also notable for having a similar format to the band''s previous single "Creep", beginning with a slow, soft acoustic verse that leads into a loud and distorted chorus. "Big Empty" appears on the greatest hits compilation album Thank You.  Allmusic critic Stephen Thomas Erlewine wrote that ""Big Empty" is a "a perfect encapsulation of mainstream alienation" and praised it as a highlight on Purple.', 12, 5),
(38, 'Vasoline', '"Vasoline" is a song by American rock band Stone Temple Pilots from their second album, Purple. The song was the second single of the album (and also the second most successful, only behind "Interstate Love Song"), reaching #1 on the Billboard Mainstream Rock Tracks chart for two weeks.[1] The song''s odd sounding intro was created by Robert DeLeo, who ran his bass through a Wah-wah pedal to get the said effect. The song''s lyrics were written by vocalist Scott Weiland. "Vasoline" also appears on the greatest hits compilation album Thank You.', 12, 5),
(39, 'Interstate Love Song', '"Interstate Love Song" is a song by the American rock band Stone Temple Pilots. Released in 1994, the song is from the second Stone Temple Pilots studio album, Purple. Considered to be one of the band''s biggest hits, "Interstate Love Song" reached number one on the Mainstream Rock Tracks chart on September 17, 1994. The song it replaced at number one was "Vasoline", also by Stone Temple Pilots. The song stayed at number one for 15 weeks, a record at the time. In 2003, "Interstate Love Song" was featured on the greatest hits compilation Thank You. In 2009, it was named the 58th best hard rock song of all time by VH1.', 12, 5),
(40, 'Unglued', '"Unglued" is a 1994 promo single from Stone Temple Pilots'' second album Purple. It was performed live on the Late Show with David Letterman in December 1994. STP had appeared on Letterman twice before, to perform their songs "Wicked Garden" and "Vasoline", and would appear four more times. The song, like "Vasoline", is known for its odd-sounding guitar intro and prominent bass. "Unglued" was only a minor hit for the band, but can still be heard on radio stations in the United States and remains a staple in their live shows.', 12, 5),
(41, 'Pretty Penny', '"Pretty Penny" is a 1995 promo single from Stone Temple Pilots'' 1994 album Purple. It differs greatly in style from the rest of the songs on the album, and serves as a calm, old-fashioned interlude between the distorted and delirious "Still Remains" and the aggressive, sinister "Silvergun Superman".  According to lead vocalist Scott Weiland, this song was his last desperate attempt to prove to himself that he was not a drug addict; his heroin addiction later became a huge problem for the band and led to two hiatuses.', 12, 5),
(42, 'Jesus Christ Pose', '"Jesus Christ Pose" is a song by the American rock band Soundgarden, released in 1991 as the first single from the band''s third studio album, Badmotorfinger (1991). The song was included on Soundgarden''s 1997 greatest hits album, A-Sides.', 13, 6),
(43, 'Outshined', '"Outshined" is a song by the American rock band Soundgarden. Written by frontman Chris Cornell, "Outshined" was released in 1991 as the second single from the band''s third studio album, Badmotorfinger (1991). The song was included on Soundgarden''s 1997 greatest hits album, A-Sides, the 2010 compilation album, Telephantasm and the live album Live on I-5.', 13, 6),
(44, 'Rusty Cage', '"Rusty Cage" is a song by the American rock band Soundgarden. Written by frontman Chris Cornell, "Rusty Cage" was released in 1992 as the third single from the band''s third studio album, Badmotorfinger (1991). The song became an instant hit and was released as a single in several different formats. The song was included on Soundgarden''s 1997 greatest hits album, A-Sides and the 2010 compilation album Telephantasm.', 13, 6),
(45, 'Loud Love', '"Loud Love" is a song by the American rock band Soundgarden. Written by frontman Chris Cornell, "Loud Love" was released on August 30, 1989 as the first single from the band''s second studio album, Louder Than Love (1989). It is the quasi-title track from album, and was also the basis for the EP Loudest Love and the live video Louder Than Live. The song was included on Soundgarden''s 1997 greatest hits album, A-Sides.', 14, 6),
(46, 'Hands All Over', '"Hands All Over" is a song by the American rock band Soundgarden. Featuring lyrics written by frontman Chris Cornell and music written by guitarist Kim Thayil, "Hands All Over" was released in 1990 as the second single from the band''s second studio album, Louder Than Love (1989). It also appeared on the band''s EP Loudest Love, released in 1990. The song was included on Soundgarden''s 1997 greatest hits album, A-Sides and appeared on the band''s compilation album Telephantasm.', 14, 6),
(47, 'Gigantic', '"Gigantic" is a song by the American alternative rock band Pixies, co-written by bassist Kim Deal and lead vocalist/guitarist Black Francis. The song appeared on the band''s first studio album, Surfer Rosa, released in 1988. "Gigantic" was released as the band''s first single later that year.  Featuring Deal on lead vocals, the song is one of Pixies'' biggest hits and a crowd favorite at concerts, often played as the encore. The melody line comes from Deal''s simple but effective bass playing—the same bassline is repeated throughout the song.  "Gigantic" never achieved a ranking on any major charts and was their only release from Surfer Rosa. However, it was a fairly successful first hit for Pixies and maintains radio play to this day. The single version of the song appeared on Pixies'' 2004 best-of compilation, Wave of Mutilation: Best of Pixies.', 15, 7),
(48, 'Where Is My Mind?', '"Where Is My Mind?" is a song by the American alternative rock band Pixies. It is the seventh track on their 1988 album Surfer Rosa. The song was written by frontman Black Francis while he attended the University of Massachusetts Amherst, inspired by his experiences scuba diving in the Caribbean. He later said he had "this very small fish trying to chase me. I don''t know why — I don''t know too much about fish behavior."', 15, 7),
(49, 'Bullet with Butterfly Wings', '"Bullet with Butterfly Wings" is a song by American alternative rock band The Smashing Pumpkins. It was the lead single from the band''s 1995 double album Mellon Collie and the Infinite Sadness. The song won the 1997 Grammy Award for Best Hard Rock Performance. This song was the band''s first Top 40 U.S. hit, peaking at number 22 on the Billboard Hot 100. It also spent six weeks at number 2 on the Modern Rock Tracks chart, and peaked at number 4 on the Album Rock Tracks chart. The song was named the 91st best hard rock song of all time by VH1. The song was ranked number 70 on the list of "The 100 Greatest Guitar Songs of All Time" of Rolling Stone. The song came second in the Triple J Hottest 100, 1995, it was also voted #33 in the Hottest 100 of All Time, 1998 and #51 on the Hottest 100 of All Time, 2009.', 16, 8),
(50, '1979', '"1979" is a song by American alternative rock band The Smashing Pumpkins. Released in 1996 as the second single from their third studio album, Mellon Collie and the Infinite Sadness, "1979" was written by frontman Billy Corgan, and features loops and samples that were uncharacteristic of previous Smashing Pumpkins songs. The song was popular with critics and fans; Allmusic''s Amy Hanson called it a "somewhat surprising hit". The song was nominated for the Record of the Year and Best Rock Performance by a Duo or Group with Vocal at the Grammy Awards, and won an MTV Video Music Award for Best Alternative Video.', 16, 8),
(51, 'Tonight, Tonight', '"Tonight, Tonight" is a song by American alternative rock band The Smashing Pumpkins, written by the band''s frontman, Billy Corgan. It was the fourth single and second track from their third album, Mellon Collie and the Infinite Sadness, and was released in April 1996. "Tonight, Tonight" was critically acclaimed and commercially well-received upon its release. The music video accompanying the song was also successful and won several awards.  A shorter acoustic version of the song, titled "Tonite Reprise", was included as a B-side to the single and on the triple LP version of Mellon Collie. This single also later appeared in an extended form on the box set The Aeroplane Flies High. Additionally, the song appears on the band''s greatest hits release, Rotten Apples.', 16, 8),
(52, 'Zero', '"Zero" is a song by American alternative rock band The Smashing Pumpkins. It was the third single from their third album, Mellon Collie and the Infinite Sadness. "Zero" was written by Corgan and was the first song recorded for Mellon Collie. The song has six rhythm guitars, with two line-in twelve string acoustics. The cover artwork features photography by Corgan''s girlfriend at the time, Yelena Yemchuk, who also directed the music video.', 16, 8),
(53, 'Muzzle', '"Muzzle" is a song by American alternative rock band The Smashing Pumpkins from their third album, Mellon Collie and the Infinite Sadness. It was one of the last songs written by Billy Corgan for Mellon Collie, with the song''s lyrics referring to what Corgan thought the public''s perception was of him at the time. It was rumored to be the Smashing Pumpkins fifth and final single from this album, as is evidenced by the fact that a promotional single for the song was issued to radio stations worldwide. However, the song "Thirty-Three" was released as the fifth and final single instead.  There was a rumor that a music video was actually filmed for "Muzzle" with Chamberlin, but was never released. Billy Corgan has, however, denied this. The band went on to perform "Muzzle" for their next television appearance on Late Night with Conan O''Brien with replacement drummer, Matt Walker.', 16, 8),
(54, 'Thirty-Three', '"Thirty-Three" is a song by American alternative rock band The Smashing Pumpkins. It was the fifth and final single from their third album, Mellon Collie and the Infinite Sadness. It was also the first single released after the firing of Jimmy Chamberlin and death of Jonathan Melvoin. The song peaked at 39 on the Billboard Hot 100 in late 1996.', 16, 8),
(55, 'The Devil''s Orchard', '“The Devil’s Orchard” was the lead single for Opeth''s tenth studio album, Heritage (2011).', 17, 9),
(57, 'Paranoid Android', '"Paranoid Android" is a song by English alternative rock band Radiohead, featured on their 1997 third studio album OK Computer. The lyrics of the darkly humorous song were written primarily by singer Thom Yorke, following an unpleasant experience in a Los Angeles bar. At more than six minutes long and containing four distinct sections, the track is significantly influenced by The Beatles'' "Happiness Is a Warm Gun" and Queen''s "Bohemian Rhapsody". "Paranoid Android" takes its name from Marvin the Paranoid Android of Douglas Adams'' The Hitchhiker''s Guide to the Galaxy series.  When released as the lead single from OK Computer, "Paranoid Android" charted at number three on the UK Singles Chart. It was well received by music critics and highlighted in many reviews of OK Computer. The track has appeared regularly on lists of the best songs of all time, including Rolling Stone''s 500 Greatest Songs of All Time. Its animated music video, directed by Magnus Carlsson, was placed on heavy rotation on MTV, although the network censored portions containing nudity. Since its release, the track has been covered by numerous artists working in a variety of musical genres.', 18, 10),
(58, 'Karma Police', '"Karma Police" is a song by English alternative rock band Radiohead from their 1997 third studio album OK Computer. The song''s title and lyrics derive from an in-joke among the band, referring to the Hindu theory of cause and effect, known as karma.  "Karma Police" was released as the second single from OK Computer, and became a commercial success, charting at number eight on the UK Singles Chart and number fourteen on the US Hot Modern Rock Tracks. Critical reception to the single was also favourable.', 18, 10),
(59, 'No Surprises', '"No Surprises" is a song by the English alternative rock band Radiohead. It was released as the third and final single from the group''s 1997 album OK Computer. It was accompanied by a music video that featured a single shot of singer Thom Yorke''s head in a plastic bubble filling with water. The single peaked at number four in the United Kingdom. In October 2011, NME placed it at number 107 on its list "150 Best Tracks of the Past 15 Years". It was featured in the episode "Broken" of the television series House when Dr. House was in rehab, and in an episode of The Royle Family in a memorable scene where Denise and Dave are playing it and humming it to put their baby David to sleep.', 18, 10),
(60, 'Face of Melinda', '"Face of Melinda" is, for the most part, another ballad; while it does not contain death metal vocals, it does contain guitar riffs that are typical of the band''s heavier songs. A fretless bass guitar along with brushes in place of conventional drumsticks were used in "Face of Melinda" to give it a jazzier sound.', 19, 9),
(61, 'Bleak', '"Bleak" is the second track off of Opeth''s 2001 album "Blackwater Park".', 20, 9);
